import { Tzip16Module, MichelsonStorageView } from "@taquito/tzip16";
import { dappClient, voteEscrowAddress } from "../../common/walletconnect";
import veNftMetaData from "../../../public/assets/ve_nft_metadata.json";
import { RpcReadAdapter } from "@taquito/taquito";
import { BigNumber } from "bignumber.js";

/**
 * Returns the veNFT thumbnail uri for the selected lock id.
 * @param lockId - Id of the lock
 */
export const getThumbnailForVeNFT = async (lockId: number): Promise<string> => {
  try {
    const { CheckIfWalletConnected } = dappClient();
    const walletResponse = await CheckIfWalletConnected();
    if (!walletResponse.success) {
      throw new Error("Wallet connection failed");
    }
    const Tezos = await dappClient().tezos();
    Tezos.addExtension(new Tzip16Module());

    const metadataStorage = veNftMetaData.views[0].implementations[0].michelsonStorageView;
    const voteEscrowInstance = await Tezos.contract.at(voteEscrowAddress);
    // const voteEscrowInstance = await Tezos.contract.at("KT1Akspdq4teMX2UVGWdMFY85PpBnCX36U6Y");

    const view = new MichelsonStorageView(
      "token_metadata",
      voteEscrowInstance,
      //@ts-ignore
      Tezos.rpc,
      new RpcReadAdapter(Tezos.rpc),
      metadataStorage.returnType,
      metadataStorage.code,
      metadataStorage.parameter
    );

    const result = await view.executeView(lockId);

    const thumbnailUri: string = Buffer.from(
      result.token_info.get("thumbnailUri"),
      "hex"
    ).toString();

    return thumbnailUri;
  } catch (error: any) {
    console.log(error);
    return "";
  }
};

